import React from 'react';

const Post = ({ post }) => {
  return (
    <div className="post">
      <h2>{post.title}</h2>
      <p>{post.content}</p>
      <p>Created by: {post.author}</p>
      <p>{new Date(post.createdAt).toLocaleDateString()}</p>
    </div>
  );
};

export default Post;
